import React from "react";
import SearchBar from "../SearchBar";
import style from "../Nav/Nav.module.css";
import Link from "react-router-dom";

const Nav = ({ onSearch }) => {
  return (
    <div className={style.container}>
      <ul>
        <li>
          <SearchBar onSearch={onSearch} />
        </li>
        <li>
          <Link to={"/home"}>
            <span>HOME</span>
          </Link>
        </li>
        <li>
          <Link to={"/about"}>
            <span>ABOUT</span>
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
